import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import TableauReact from "../components/tableau";
import HomePage from "../components/HomePage";
import Scenario1 from "../components/Scenario1";
import ExportPDF from "../components/ExportPDF";
import Filter from "../components/Filter";
import GetData from "../components/GetData";
import Resize from "../components/Resize";
import Events from "../components/Events";
import Home from "../components/Home";

function Main() {
  return (
    <section>
      <Route path="/" exact component={Home} />
      <Route path="/home/" component={HomePage} />
      <Route path="/scenario1/" component={Scenario1} />
      <Route path="/export-pdf/" component={ExportPDF} />
      <Route path="/filter/" component={Filter} />
      <Route path="/get-data/" component={GetData} />
      <Route path="/resize/" component={Resize} />
      <Route path="/events/" component={Events} />
      {/* testing sending string prop and destructure in component */}
    </section>
  );
}

export default Main;
